import data from "../db/data.json"
import Galcard from "./Galcard";
import "./Gal.css";

const GalSelect = () => {

    const items  = data.response.body.items.item ;
    console.log(items)
   
    return (
        <>
            <Galcard cardItem={items[0]}/>
            <Galcard cardItem={items[1]}/>
            <Galcard cardItem={items[2]}/>
            <Galcard cardItem={items[2]}/>
            <Galcard cardItem={items[2]}/>
            <Galcard cardItem={items[2]}/>
            <Galcard cardItem={items[2]}/>
            <Galcard cardItem={items[2]}/>
            <Galcard cardItem={items[2]}/>
            
        </>
    );
}
export default GalSelect ;
